html, body{
	background-color: rgb(0, 0, 0);
	margin: auto;
	padding: 0;
	height: 100%;
	width: 100%;
}


.woah { 
    width: 100%;
	height: 100vh;
}

.woah video {
	width: 100%;
	height: 100%;
	position: absolute;
	top: 0;
	left: 0;
	z-index: 5;
	object-fit: cover;
}

#header{
	text-align: center;
	width: 100%;
	position: fixed;
	height: 50px;
	top: 0;
	z-index: 99;
	top: 10px;
}

#header img{
	width: 100px;
}

#menu {
	padding: 20px 0 20px 0;
	position: absolute;
	width:100px;
	height: 100px;
	top: 50%;
	margin-top: -110px;
	list-style-type: none;
}
#menu a{
	font-size: 25px;
}
#menu li {
	margin: 20px 40px;
}
#menu li a {
    color: rgb(255, 255, 255);
    text-decoration: none;
}
#menu a:hover {
	color: rgb(74, 233, 95);
  }
#menu .active a {
    color: rgb(74, 233, 95);
}
@media screen and (max-width: 700px) {
	#menu{
		display: none;
	}

}

.s1 {
	background: url('../images/IMG_4167-3.jpg');
	background-color: #000000;
	background-position: 50%;
	background-repeat: no-repeat;
	background-size: cover;
	height: 100%;
}


.s2{
	background: url('../images/IMG_4895-min.jpg');
	background-color: #000000;
	background-position: 50%;
	background-repeat: no-repeat;
	background-size: cover;
	height: 100%;
	width: 100%;
	text-align: center;
}

.s2 img{
	background: none;
	width: 150px;
	height: 150px;
	padding: 20px;
	color: rgb(255, 255, 255);
}

.s2 ul {
	padding: 0;
	list-style-type: none;
}

@media (min-width:750px){
.s2 li{
	padding: 5%;
	margin: auto;
	display: inline-block;
}

}
#artists{
	height: 100%;
	width: 100%;
	left: 0;
	margin: auto;
}


.s3 {
	background: url('../images/Artboard1.jpg');
	background-color: #f15ff1;
	background-position: 50%;
	background-repeat: no-repeat;
	background-size: cover;
	height: 100%;
	text-align: center;
}
@font-face{
	src: url('../fonts/HKINIGHT.TTF');
	font-family: 'nos';
}


.button {
	font-family: 'nos';
	background-color: #3cf34b;
	border-radius: 12px;
	color: white;
	padding: 15px 32px;
	text-align: center;
	text-decoration: none;
	display: inline-block;
	font-size: 40px;
	margin: 4px 2px;
	cursor: pointer;
  }
.button1{
  font-family: 'nos';
  background-color: transparent; 
  color: rgb(255, 255, 255); 
  border: 2px solid #3cf34b;
}

.button1:hover{
	background-color: #000000;
}
.button2{
  background-color: transparent; 
  color: rgb(255, 255, 255); 
  border: 2px solid #3cf34b;
}
.button2:hover{
	background-color: #000000;
}


.s4 {
	background: url('../images/tickets.png');
	background-color: #44dba9;
	background-position: 50%;
	background-repeat: no-repeat;
	background-size: cover;
	height: 100%;
	text-align: center;
}

#socials{
	height: 20px;
	position:fixed;
	bottom:0;
	width:100%;
	font-size: 25px;
	text-align: center;
	padding: 10px 0 10px 0;
}

#socials li a{
    text-decoration: none;
	display: block;
	color: rgb(255, 255, 255);
}
#socials li a:hover{
	color: rgb(74, 233, 95);
}
#socials li{
	margin: 0 5px;
	display:inline-block;
	position:relative;
}


.max{
	max-width: 560px;
	margin: 0 auto;
	padding: 50px;
}

.iframe-container{
	position: relative;
	width: 100%;
	padding-bottom: 56.25%; 
	padding-top: 25px;
	height: 0;
  }

.iframe-container iframe{
	position: absolute;
	top: 0px;
	bottom: 0px;
	left: 0px;
	right: 0px;
	width: 100%;
	height: 100%;
  }


  /* ALLEGRO SITE */
.allegroplayer{
	padding-left: 25%;
	width: 50%;
	padding-top: 25%;
}

  /* nogi SITE */
.nogiplayer{
	padding-left: 25%;
	width: 50%;
	padding-top: 25%;
}

  /* CLOUD SITE */

.top {
	background: url('../images/CloudPage.jpg');
	background-color: #000000;
	background-position: 50%;
	background-size: cover;
	background-repeat: repeat;
	overflow: scroll;
	height: 100%;
	width: 100%;
}

#cloud-header{
	text-align: center;
	width: 100%;
	position: fixed;
	height: 50px;
	top: 0;
	z-index: 99;
	top: 10px;
}

#cloud-header img {
	width: 100px;
}


#cloud-list {
	display: flex;
	flex-wrap: wrap;
	align-items: center;
	justify-content: center;
	height: 100%;
	margin: 0;
	padding-top: 100px;
	padding-bottom: 0px;
}

#cloud-list img{
	width: 300px;
	padding: 10px 10px 10px 10px;

}

@media (max-width: 750px){
	#cloud-list {
		display: flex;
		flex-wrap: wrap;
		align-items: center;
		justify-content: center;
	}
	#cloud-list img{
		width: 200px;
		padding: 0 50px;
	}
}

.top-allegro {
	background: url('../images/CloudPage.jpg');
	background-color: #000000;
	background-position: 50%;
	background-size: cover;
	background-repeat: repeat;
	overflow: scroll;
	height: 100%;
	width: 100%;
}
